css:
.deprecation-cop-status .icon.icon-alert:before {
  width: 17px;
}
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #2b303b !important;
}
.deprecation-cop .deprecation-info {
  padding: 0 10px;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #343d46 !important;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #1c1f26;
  padding: 10px;
  margin-bottom: 10px;
}
.deprecation-cop a {
  color: #c0c5ce;
}
